// src/pages/DefaultDashboard.js
import React from 'react';
import LightweightChart from '../LightweightChart';
import SetupFeed from '../components/setupFeed';
import SetupReview from '../components/setupReview';
import { exportSetupLogCSV } from '../alerts/setupLogger';

const DefaultDashboard = () => {
  const handleExport = () => {
    const csv = exportSetupLogCSV();
    const blob = new Blob([csv], { type: 'text/csv;charset=utf-8;' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.setAttribute('download', 'defaultdashboard_setups.csv');
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>ðŸ§  ICC Dashboard â€” Real-time Setup Feed</h2>
      <LightweightChart symbol="AAPL" timeframe="3m" />
      <SetupFeed filterDashboard="DefaultDashboard" />
      <SetupReview filterDashboard="DefaultDashboard" />
      <button onClick={handleExport} style={{ marginTop: '1rem' }}>
        ðŸ“¤ Export ICC Setups to CSV
      </button>
    </div>
  );
};

export default DefaultDashboard;
